import React, { useEffect, useState } from 'react';
import { load2025Data, get2025Standings } from '../utils/f1Data';

const Leaderboard = ({ customization }) => {
  const [standings, setStandings] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchData = async () => {
      await load2025Data();
      setStandings(get2025Standings());
      setLoading(false);
    };

    fetchData();
  }, []);

  if (loading) return <div className="loading">Loading 2025 standings...</div>;

  return (
    <div className="leaderboard-container">
      <h2>2025 FIA Formula One World Championship</h2>
      {/* Rest of your leaderboard table */}
    </div>
  );
};

export default Leaderboard;
